import React from 'react';

class Register extends React.Component {

	constructor(props) {
			super(props);
			this.state = {
				email: '',
				password: '',
				name:''
			}
		}

		onEmailChange = (event) => {
			this.setState({email: event.target.value})
		}

		onNameChange = (event) => {
			this.setState({name: event.target.value})
		}

		onPasswordChange = (event) => {
			this.setState({password: event.target.value})
		}


	render() {
		const { onRouteChange } = this.props;
		return (
			<article className="br3 ba shadow-5 b--black-10 mv4 w-100 w-50-m w-25-l mw6 center">
				<main className="pa4 black-80">
				  <div className="measure">
				    <fieldset id="register" className="ba b--transparent ph0 mh0">
				      <legend className="f1 fw6 ph0 mh0">Registration</legend>
				      <div className="mt3">
				        <label className="db fw6 lh-copy f6" htmlFor="first-name">Name</label>
				        <input className="pa2 input-reset ba bg-transparent hover-bg-black hover-white w-100" type="text" name="first-name"  id="first-name" />
				      </div>
				      <div className="mt3">
				        <label className="db fw6 lh-copy f6" htmlFor="email-address">Email</label>
				        <input className="pa2 input-reset ba bg-transparent hover-bg-black hover-white w-100" type="email" name="email-address"  id="email-address" />
				      </div>
				      <div className="mv3">
				        <label className="db fw6 lh-copy f6" htmlFor="password">Password</label>
				        <input className="b pa2 input-reset ba bg-transparent hover-bg-black hover-white w-100" type="password" name="password"  id="password" />
				      </div>
				    </fieldset>
				    <div className="">
				      <input 
				      onClick = { () => onRouteChange('home')}
				      className="b ph3 pv2 input-reset ba b--black bg-transparent grow pointer f6 dib" 
				      type="submit" value="Register"/>
				    </div>
				  </div>
				</main>
			</article>
				);
	}
}

export default Signin;
